import './scss/app.scss';
// console.log(pizzas);

function App() {
  const [items, setItems] = React.useState([])
  const [isLoading, setisLoading] = React.useState(true)

  // https://6298dccebf77b60258227c16.mockapi.io/items

  React.useEffect(() => {

    fetch('https://6298dccebf77b60258227c16.mockapi.io/items')
      .then((res) => res.json())
      .then((json) => {
        setItems(json);
        setisLoading(false)
      })
  }, [])
  return (
    <div className="wrapper">
      <Header />
      <div className="content">
        <div className="container">

        </div>
      </div>
    </div>
  );
}

export default App;
